import React from 'react';
import './styles.css';
import logo from './logo.svg'
import NavBar from './components/NavBar';
import { Navbar, NavItem } from 'react-materialize' 

function App() {
  return (
    <div className="App">
      <Navbar 
        alignLinks="right"
        brand={<img src={logo}/>}

      >
        <NavItem>
          Hello
        </NavItem>
        <NavItem>
          World!
        </NavItem>
      </Navbar>
    </div>
  );
}

export default App;
